import React, { useRef, useEffect, useState } from 'react';
const TimeImage = () => {
  const getRandom = (min, max) => Math.floor(Math.random()*(max-min+1)+min);

  const square= document.getElementById('#overimage');
  setInterval(() => {
     square.style.left= getRandom(0, 300 - 200)+'px'; // üëàüèº Horizontally
     square.style.top = getRandom(0, 300 - 200)+'px'; // üëàüèº Vertically

  }, 500);

}


export default TimeImage
